import React, { Component } from 'react';
import ReactDOM from 'react-dom';


class Menu extends Component {

    render() {
        return (
            <div className='menu'>
                    <ul className='menu__list'>
                        <li><a className='menu__itens' href='#'>HOME</a></li>
                        <li><a className='menu__itens' href='#'>FAQ</a></li>
                        <li><a className='menu__itens' href='#'>LOCAIS</a></li>
                        <li><a className='menu__itens' href='#'>CATEGORIAS</a></li>
                    </ul>       
            </div>
        )
    };
}

export default Menu;
